Brown toned makeup is always one of my absolute faves as it’s impactful but soft & sultry at the same time! It also suits every eye colour & every skin tone 👌🏼🤎✨

The key to sultry is blending & a light touch - don’t go to heavy & add small amounts of shadow or liner to build the intensity. Always use a clean brush to buff out any harsh lines.. this is what makes shadow look flawless! Also go for a brown mascara for an even softer look 🫶

